load two_moons.mat[dim, dataSize] = size(data);global N;N = 100; % Number of classes considered known% In data, each column is an observation.global C;C = data(:, 1:N);% Map 1 -> 1 and 2 -> -1global t;t = -2 * labels .+ 3;w = findCoefficient(C, t(1:N), 10^7);function y = classify(x, w)  y = sign(w' * phi(x));endaccurate = 0;for i = (N+1):dataSize  if (classify(data(:, i), w) == t(i))    accurate = accurate + 1;  endend